import Layout from '../components/Layout';
import { motion } from 'framer-motion';
import React from 'react';
import { Camera } from 'react-feather';

const HomePage = () => (
 <Layout>
  <motion.div initial='hidden' animate='visible' variants={{
    hidden: {
      scale: .8,
      opacity: 0
    },
    visible: {
      scale: 1,
      opacity: 1,
      transition: {
        delay: .4
      }
    },
  }}>
    <div className={'flex justify-center pt-12  font-bold sm:text-1lg text-4xl'
     }>
      <h1>Welcome to Home Page</h1>
    </div>
  </motion.div>
  <Camera color="blue" size={48} className={'my-0 mx-auto pt-16'}/>
 </Layout>
);

export default HomePage
